INSERT INTO `infracoes` VALUES (8477,'Alimentar-se em sala de aula no horário das aulas, bem como nos laboratórios, auditório e biblioteca, sem autorização do(a) professor(a).','LEVE'),(8478,'Ausentar-se da sala de aula ou do local de trabalho escolar sem autorização do(a) respectivo(a) professor(a) ou da Coordenação/Departamento de Ensino.','LEVE'),(8479,'Comercializar lanches.','LEVE'),(8480,'Deixar de usar uniforme no interior do campus durante o período das atividades educacionais, solenidades cívicas e quando estiver em representações do IFNMG.','LEVE'),(8481,'Distribuir impressos, divulgar folhetos, fazer exibições ou comunicações públicas, dentro da Instituição, sem a autorização da direção-geral.','LEVE'),(8482,'Entrar ou sair das dependências da Instituição de forma inadequada, tais como, pulando muros, portões, grades, etc.','LEVE'),(8483,'Nadar nos rios, lagoas e represas do campus.','LEVE'),(8484,'Namorar de forma extravagante e/ou praticar qualquer ato que enseje comportamento inadequado nas dependências da Instituição ou em atividades de representação do IFNMG.','LEVE'),(8485,'Não comparecer, sem prévia justificativa, às reuniões, palestras ou eventos diversos para os quais tenha sido convocado(a).','LEVE'),(8486,'Organizar arrecadações pecuniárias em proveito próprio.','LEVE'),(8487,'Outras não constantes nesse rol e que possam ser equiparadas.','LEVE'),(8488,'Permanecer em sala de aula ou no local de trabalho escolar após o término das atividades escolares, sem autorização.','LEVE'),(8489,'Promover encontros, congressos estudantis no recinto do campus sem o prévio conhecimento e devido deferimento da Coordenação/Departamento de Ensino.','LEVE'),(8490,'Promover ou participar de jogos que envolvam apostas, ainda que eventualmente.','LEVE'),(8491,'Submeter colegas ou servidores(as) a constrangimento.','LEVE'),(8492,'Transgredir normas de funcionamento da biblioteca, do refeitório, da quadra esportiva, dos laboratórios, da sala de aula, do auditório, da moradia estudantil, entre outras.','LEVE'),(8493,'Utilizar e manter ligado telefone celular, aparelhos e jogos eletrônicos durante as aulas teóricas, práticas ou avaliativas, sem autorização do(a) professor(a).','LEVE'),(8494,'Deixar as dependências do campus sem autorização, se menor de idade.','GRAVE'),(8495,'Depredar, cortar, derrubar, arrancar árvores nas dependências do Instituto.','GRAVE'),(8496,'Desrespeitar os princípios de hierarquia administrativa do IFNMG.','GRAVE'),(8497,'Frequentar e/ou permanecer nas dependências da Instituição, sem autorização, fora do horário de funcionamento.','GRAVE'),(8498,'Frequentar, sem autorização, os locais de acessos restritos identificados com placas e/ou as unidades de produção fora do horário de aulas.','GRAVE'),(8499,'Impedir a entrada de colegas às aulas ou instigá-los(as) a faltas coletivas.','GRAVE'),(8500,'Obrigar colegas a executar tarefas a si atribuídas.','GRAVE'),(8501,'Omitir ocorrências como trotes, furtos, roubos ou outros fatos graves ocorridos nas dependências do campus.','GRAVE'),(8502,'Outras não constantes nesse rol e que possam ser equiparadas.','GRAVE'),(8503,'Participar de movimentos de indisciplina.','GRAVE'),(8504,'Permanecer nos setores de produção e laboratórios sem a devida autorização do(a) professor(a) responsável.','GRAVE'),(8505,'Perseguir, criar, apreender, causar sofrimento ou matar animais domésticos e/ou silvestres nas dependências da Instituição de Ensino.','GRAVE'),(8506,'Perturbar a ordem em salas de aulas, corredores, unidades/setores de produção e demais dependências do Instituto.','GRAVE'),(8507,'Pichar, grafitar, escrever, desenhar ou, por outro meio, sujar as edificações, equipamentos e mobiliários.','GRAVE'),(8508,'Praticar atos libidinosos.','GRAVE'),(8509,'Proferir expressões injuriosas, caluniosas ou difamatórias contra seus(suas) colegas, servidores(as) e/ou funcionários(as) de empresas terceirizadas que prestam serviço para o campus ou qualquer outra pessoa nas dependências da Instituição ou em missão de representação desta.','GRAVE'),(8510,'Acessar, oferecer, trocar, disponibilizar, transmitir, distribuir, publicar ou divulgar fotografia, texto, imagem, vídeo ou outro registro no interior do campus, ou quando estiver representando esse, que contenha cena de sexo, pornografia, ou que exponha qualquer pessoa a situação vexatória.','GRAVÍSSIMA'),(8511,'Adquirir, portar, guardar, oferecer ou fornecer a outrem, substâncias entorpecentes ou que determinem dependência física ou psíquica, ainda que gratuitamente, no interior do campus ou fora dele, quando estiver representando a Instituição de ensino.','GRAVÍSSIMA'),(8512,'Apoderar-se indevidamente de objetos alheios.','GRAVÍSSIMA'),(8513,'Causar danos materiais ao patrimônio do IFNMG e/ou de particulares, ficando, inclusive, obrigado(a) ao ressarcimento pelos eventuais prejuízos que causar, sem a exclusão da medida disciplinar cabível.','GRAVÍSSIMA'),(8514,'Cometer atentado ao pudor.','GRAVÍSSIMA'),(8515,'Cultivar, usar ou portar substâncias tóxicas, alucinógenas ou qualquer produto entorpecente na Instituição.','GRAVÍSSIMA'),(8516,'Desafiar, agredir, física e/ou moralmente, colegas, servidores(as), funcionários(as) ou qualquer outra pessoa nas dependências da Instituição, ou quando em missão de representação desta, com ou sem lesões corporais.','GRAVÍSSIMA'),(8517,'Fumar em recinto público, conforme o art. 2º da Lei Federal nº 9.294, de 15 de julho de 1996.','GRAVÍSSIMA'),(8518,'Liderar movimentos de indisciplina.','GRAVÍSSIMA'),(8519,'Outras não constantes nesse rol e que possam ser equiparadas.','GRAVÍSSIMA'),(8520,'Portar materiais inflamáveis, soltar fogos de artifícios, rojões ou qualquer outro tipo de artefato que cause explosão ou que possa provocar risco de lesão corporal e/ou psicológica para si ou para outrem.','GRAVÍSSIMA'),(8521,'Portar ou usar armas de fogo ou armas brancas.','GRAVÍSSIMA'),(8522,'Praticar atos definidos como crime ou ato infracional.','GRAVÍSSIMA'),(8523,'Praticar, provocar ou motivar, direta ou indiretamente, ato de racismo, injúria racial, LGBTfobia, discriminação, por sexo, idade, cor, raça, crença religiosa, estado civil, doença, orientação sexual, deficiência, nacionalidade, tradição religiosa, cultural, étnica, ou outras formas de discriminação.','GRAVÍSSIMA'),(8524,'Praticar, provocar ou motivar, direta ou indiretamente, o bullying e o cyberbullying (Lei nº 14.811, de 12 de janeiro de 2024).','GRAVÍSSIMA'),(8525,'Promover, participar ou aplicar trote contra seus(suas) colegas ou qualquer pessoa, que cause agressão física, moral, humilhação, ou outras formas de constrangimento.','GRAVÍSSIMA'),(8526,'Subtrair ou se apropriar, indevidamente, para si ou para outrem, de materiais, insumo, produtos e subprodutos da Instituição.','GRAVÍSSIMA'),(8527,'Usar de meios ilícitos ou agir de forma caluniosa, fraudulenta e antiética para tirar vantagem de qualquer natureza, em benefício próprio ou de terceiros.','GRAVÍSSIMA'),(8528,'Usar ou depositar entorpecentes, psicotrópicos ou bebidas alcoólicas no recinto da Instituição de Ensino ou onde estiver participando de delegação ou representação estudantil, bem como, apresentar-se embriagado(a) ou sob efeito de qualquer uma dessas substâncias.','GRAVÍSSIMA'),(8529,'Afixar, em qualquer parte da Instituição, cartazes, desenhos, fotos ou gravuras sem autorização.','LEVE');
/*!40000 ALTER TABLE `infracoes` ENABLE KEYS */;
